import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useHistory } from 'react-router-dom';

import { Button, Gap, ListSupplier, PageNumber } from '../../Component';
import { styContainer, styContainerBottom } from './styles';

const Home = () => {
  const [page, setPage] = useState(1);
  const [size, setSize] = useState(2);
  const [data, setData] = useState([]);
  const [totalPages, setTotalPages] = useState(0);
  const history = useHistory();

  useEffect(() => {
    setData([]);
    axios
      .get(
        `https://mobile.dev.quadrant-si.id/developertest/supplier/inquiry/${page}/${size}`
      )
      .then((res) => {
        setData(res.data.data);
        setTotalPages(res.data.totalPages);
        console.log(res.data);
      });
  }, [page, size]);

  return (
    <div className={styContainer}>
      <div>
        {data.map((e, i) => (
          <div key={i}>
            <ListSupplier data={e} />
            <Gap height={10} />
          </div>
        ))}
      </div>
      <div className={styContainerBottom}>
        <div>Total Pages : {totalPages}</div>
        <Button type="btn-plus" />
      </div>
    </div>
  );
};

export default Home;
